const HomePage = ({ userAgent}) => {
    return <div>Welcome to Next.js - { userAgent }!</div>
}

HomePage.getInitialProps = async ({req}) => {
    const userAgent = req ? req.headers['user-agent'] : navigator.userAgent;
    return {userAgent};
}

export default HomePage
